</ion-header>

<ion-content [fullscreen]="true">
  <ion-card *ngFor="">
    <ion-card-header color="primary">
      <ion-label></ion-label>
    </ion-card-header>

    <ion-card-content>
      <ion-img></ion-img>
    </ion-card-content>
  </ion-card>
</ion-content>
